//SIGNUP and API Calls developed by Sam Jose.
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

import axios from "axios";


function SignUp() {
  //variables and functions
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [fname, setF] = useState("");
  const [lname, setL] = useState("");
  
  const [role, setRole] = useState(""); //send to Accounts Table in database.

  //const [sec1, setSec1] = useState("");
  //const [sec2, setSec2] = useState("");
  //const [sec3, setSec3] = useState("");
const nav = useNavigate();
/*
  const register = async (email, password,) => {
    try {
      const response = await axios.post('http://localhost:8081/api/register', {
        email: email,
        password: password,
        secQ1: secQ1,
        secQ2: secQ2,
        secQ3: secQ3
      });
      console.log(response);
      alert("Account Made, verification send to email.");
      return response;
    } catch (error) {
      console.error('Registration error', error);
      alert("Registration failed.");
    }
  }
 // */

  const displayContent = async (e) => {
    e.preventDefault();
    console.log(email, username, password, role);
   
    // Call the register method from AuthService
 //   await register(email, password, sec1, sec2, sec3);
  //  console.log(response); // Handle the response accordingly
    alert("Account Made, verification send to email.")
  };



  return (
    <div className="div-container">
      <h2>SIGNUP PAGE</h2>

      <form action="">

        <div className="email">
          <label htmlFor="email"> </label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter Email"
          />
        </div>
        <div className="Username">
          <label htmlFor="Username"> </label>
          <input
            type="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="Enter Username"
          />
        </div>

        <div className="Password">
          <label htmlFor="Password"> </label>
          <input
            type="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Enter Password"/>
        </div>
        <div className="Role">
            <label htmlFor="Role">Select Your Role</label>

    <select name="Roles" id="Roles">
  <option value="CPC" onSelect={setRole("Conference Program Chair")}>Conference Program Chair</option>
  <option value="Author"onSelect={setRole("Author")}>Author</option>
  <option value="Reviewer"onSelect={setRole("Reviewer")}>Reviewer</option>
        </select>   
        </div>
 
        <div>
          <button onClick={displayContent}>SIGN UP </button>
          <p>YOU AGREE TO OUR TERMS AND CONDITIONS. </p>
        </div>
        <div>
          <button onClick={()=> nav("/signup/passgen")}>Password Generator Page </button>
        </div>
      </form>
    </div>
  );


}
export default SignUp;
